<?php

namespace App\Services\Commands;

use App\Jobs\DeleteFileJob;
use App\Jobs\SendMessageJob;
use App\Jobs\SendPhotoJob;
use App\Services\Base\BaseCommand;
use DESMG\RFC6986\Hash;
use Illuminate\Support\Facades\Storage;
use Longman\TelegramBot\Entities\Message;
use Longman\TelegramBot\Telegram;

class HaoKuShenYuanCommand extends BaseCommand
{
    const string BaseImage = <<<IMG

IMG;
    public string $name = 'HaoKuShenYuan';
    public string $description = 'Generate HaoKuShenYuan Stickers';
    public string $usage = '/HaoKuShenYuan {text}';

    public function execute(Message $message, Telegram $telegram, int $updateId): void
    {
        $chatId = $message->getChat()->getId();
        $messageId = $message->getMessageId();
        $text = $message->getText(true);
        $data = [
            'chat_id' => $chatId,
            'reply_to_message_id' => $messageId,
            'photo' => null,
            'caption' => "Based on Noto Sans SC.
Please <a href=\"https://github.com/google/fonts/issues\">contact Google</a> for character set issues.
This software is licensed under the AGPL, without any warranty.",
            'is_file' => true,
            'protect_content' => false,
        ];
        if (strlen($text) < 1) {
            $data = [
                'chat_id' => $chatId,
                'reply_to_message_id' => $messageId,
                'text' => 'Please input Content.',
            ];
            $this->dispatch(new SendMessageJob($data, null, 0));
            return;
        }
        $image = base64_decode(self::BaseImage);
        $baseImage = imagecreatefromstring($image);
        $baseImage = imagescale($baseImage, 512, 512);
        $image = imagecreatetruecolor(512, 512);
        $transparent = imagecolorallocatealpha($image, 0, 0, 0, 127);
        imagefill($image, 0, 0, $transparent);
        imagesavealpha($image, true);
        imagecopy($image, $baseImage, 0, 0, 0, 0, 512, 512);
        imagedestroy($baseImage);
        $font = '/usr/share/fonts/google-noto-sans-sc-fonts/NotoSansSC-Medium.otf';
        $color = imagecolorallocate($image, 255, 255, 255);
        imagettftext($image, 48, 0, 200, 320, $color, $font, $text);
        ob_start();
        imagepng($image);
        $imageData = ob_get_contents();
        ob_end_clean();
        imagedestroy($image);
        $name = Hash::sha256($imageData);
        $path = "HKSY/$name.png";
        Storage::disk('public')->put($path, $imageData);
        $this->dispatch(new DeleteFileJob($path));
        $fullPath = Storage::disk('public')->path($path);
        $data['photo'] = $fullPath;
        $this->dispatch(new SendPhotoJob($data, 0));
    }
}
